import NavBar from '../../components/navbar/navbar';
import Cards from '../../components/cards/cards';

import './home.css';

function Home() {
   return (
      <div className='home'>
         <h1 className='title'>Proyecto Dogs</h1>
         <NavBar />
         <Cards />
      </div>
   );
}

export default Home;
